    setUsers(jsonresponse);
  };
    return(
 <div className="App">
   <h1>hello all</h1>
   <button onClick={loadUsers}>Get Data</button>
   <h2>USERS:</h2>
   <ul>

     {users.map(( { id, login,avatar_url}) =>(
     <div><li key={id}>id:{id} </li>
     <li>Name: {login}</li>
     <li>Avatar:{avatar_url}  </li>
     </div>
       ))}

 </ul>
   </div>

   );
 }
